import React from "react";
import styled from "styled-components";

const Section = styled.section`
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 20px;
    padding-top: 20px;
`
const Block = styled.div`
    width: 1248px;
    height: ${({ $Height }) => ($Height ? '556px' : '267px')};
    background-color: ${({ $Fon }) => ($Fon ? '#D5DEF6' : '#E2EDD0')};
    border-radius: 10px;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: center;
`
const Button = styled.button`
    width: 1098px;
    height: 75px;
    background-color: #FFFFFF;
    color: #000000;
`
const Task = styled.h2`
    font-family: 'Montserrat';
    font-size: 16px;
    line-height: 27px;
    font-weight: 400;
    width: 1098px;
    height: 63px;
`
const Span = styled.span`
    padding-left: 7%;
`
const SampleInput = styled.strong`
    font-family: 'Montserrat';
    font-size: 16px;    
    color: #000000;
`
const LabaStud = () => {
    return ( 
        <>
            <Section>
                <Block $Height $Fon>
                    <Span>
                        <Task>
                            Даны три целых числа. Найдите наибольшее из них (программа должна вывести ровно одно целое число). Под наибольшим в этой задаче понимается число, которое не меньше, чем любое другое.
                        </Task>   
                    </Span>
                    <Span>
                        <SampleInput>
                            Формат входных данных
                        </SampleInput>
                            <p>
                                Вводятся три числа.
                            </p>
                                <SampleInput>
                                    Формат входных данных
                                </SampleInput>
                                    <p>
                                        Вводятся три числа.
                                    </p>
                                        <SampleInput>
                                            Sample Input:
                                        </SampleInput>
                                            <p>
                                                1 2 3
                                            </p>
                                                <SampleInput>
                                                    Sample Output:
                                                </SampleInput>
                                                    <p>
                                                        3
                                                    </p>   
                    </Span>

                </Block>
                <Block >
                    <Button>
                        Загрузите файл с кодом
                    </Button>
                    <Button>
                        Отправить на проверку
                    </Button>
                </Block>
                <div>

                </div>
            </Section>
        </>
     );
}

export default LabaStud;
